interface ModalProps{
    children: React.ReactNode
    title: string
    onClose: () => void
}

export function Modal({ children, title, onClose}: ModalProps) {
    return (
        <>
            <div onClick={onClose}/>
            <div> 
                <h1>{ title }</h1>

                {children}
            </div>
        </>
    )
}
